import React from 'react';
import './App.css';
import Card from './cardUI/card.js';
import CollegeList from './colleges.json';

function App() {
  const { collegeName } = this.props;
  return (
    <div>
      <Card />
      {CollegeList["colleges"].map((collegeDetail, index) => {
        return <Card collegeName = {collegeDetail.college_name} />
      })}
    </div>
  );
}

export default App;
